import React, { useState } from "react";

const Hooks = () => {
    var [count, setCount] = useState("hello")

    const handleClick = () => {
        setCount("hello world");
        console.log(count);
    }
    return(
        <>
            <h1>{count}</h1>
            <button onClick={handleClick}>clicki</button>
            
        </>
    )
}
export default Hooks;
